INSERT INTO `about_us` (`id`, `upper_section_english`, `upper_section_arabic`, `middle_section_english`, `middle_section_arabic`, `lower_section_english`, `lower_section_arabic`, `created_on`, `updated_on`) VALUES
(1, 'You can get designs from anywhere right? But getting quality designs that reflect our culture, language, and preferences was always difficult. So we came up with a solution, Bundl! \r\n \r\n<br> Where we sorted different design items in 5 curated bundls tailored to your business or project, and if you didn’t find what you’re looking for, we created a bundl where you can mix and match to customize your own!\r\n \r\n<br> Our process is simple, fast and straightforward. All you have to do is follow 5 easy steps!\r\n', '\r\nتقدر تصمم هوية مشروعك من أي مكان صح؟ لكن إنك تحصل على تصاميم تناسب مشروعك، لغتك، ثقافتك، وتكون عالية الجودة هو التحدي. وعشان كذا اشتغلنا على الحل! \r\n<br> \r\nأنشأنا ٥ باقات تصميم مختلفة، كل باقة تحتوي على عناصر مختارة تناسب مجالات مختلفة. واذا مالقيت باقة تناسبك، تقدر تصمم باقتك وتختار العناصر اللي تحتاجها فقط! \r\n<br> \r\nطريقتنا سهلة وبسيطة، كل اللي عليك انك تتبع ٥ خطوات فقط للحصول على تصاميمك \r\n', 'Bundl is the first Saudi platform that offers custom designs through a seamless digitized process, for business owners looking for creative, high-quality customized designs. ', 'بندل أول منصة سعودية توفر خدمات تصميم بطريقة سهلة وإلكترونية بحتة، لأصحاب المشاريع والمهتمين في الحصول على تصاميم مخصصة عالية الجودة سواء لمنتجاتهم أو خدماتهم. ', 'The platform is created and managed by two Saudi women who lived between Riyadh and Dubai most of their lives, and were passionate about design, branding, marketing, and social media for more than a decade. The founder, Hala, has more than 15 years of experience in Branding and Graphic Design.\r\n \r\n<br> While Sara, has her experience in marketing, business development and project management. Together, they were able to create a modern format in the region to support business owners turn their dreams into a creative reality. \r\n', 'تم إنشاء المنصة وإدارتها من قبل سيدتين سعوديتين عاشتا بين الرياض ودبي معظم حياتهما ، وكانتا شغوفتين بالتصميم والعلامات التجارية والتسويق ووسائل التواصل الاجتماعي لأكثر من عقد من الزمان. تتمتع المؤسسة هالة ، بأكثر من 15 عامًا من الخبرة في مجال العلامات التجارية والتصميم.\r\n <br> \r\nبينما تتمتع سارة ، بخبرتها في التسويق وتطوير الأعمال وإدارة المشاريع. تمكنتا معًا من إنشاء منصة جديدة في المنطقة لدعم أصحاب الأعمال وتحويل أحلامهم إلى حقيقة إبداعية.\r\n', '2020-11-12 14:19:31', '2022-11-15 07:44:06');
