(8, 'Animator/Motion Graphics ', '<p>We are looking for an animator/Motion Graphics designer to join our team of creatives on a project basis.</p>\r\n<p><strong>Job discerption:</strong></p>\r\n<p>&bull;Working creatively to produce original and aesthetically pleasing designs, visual effects and animations</p>\r\n<p>&bull;Creating, planning, and scripting animated narrative sequences</p>\r\n<p>&bull; Integrating music, sound effects and balances of audio</p>\r\n<p>&bull;Editing animation and effects based on feedback</p>\r\n<p>&bull; Working collaboratively with Creative Heads to create high-quality video content.</p>', '<p>&bull; Motion Graphics, Animator proficient in 2D &amp; 3D work and able to operate alone on individual projects as well as working with a team of creatives</p>\r\n<p>&bull; Experienced in Video editing, video coloring, retouching and post production effects</p>\r\n<p>&bull; Strong planning and organizational skills with the ability to set targets, prioritize effectively and make decisions</p>\r\n<p>&bull; Designing web banners and responsive emailers in HTML</p>\r\n<p>&bull; Creates compelling motion content through 2D and 3D applications to amplify and elevate our ideas</p>\r\n<p>&bull; Think creatively and develop new design concepts, graphics and layouts</p>\r\n<p>&bull; Work with the team to create modern and forward-thinking design concepts based on social and digital trends and data</p>\r\n<p>&bull; Execute concepts flawlessly into motion graphics, web banners, video executions and static designs</p>\r\n<p>&bull; Manage timelines for content delivery</p>\r\n<p>&bull;You have the ability to work under pressure and meet tight deadlines</p>\r\n<p>&bull;You have strong analytical skills and a keen eye to ensure that the content is free from errors and complies with editorial style and design guidelines</p>\r\n<p>&bull;You are highly goal-driven and work well in fast-paced environments</p>\r\n<p><strong>Job Types:</strong> Project base</p>\r\n<p><strong>Language: </strong>Arabic (Preferred)</p>', 'مصمم غرافيكي/موشن غرافيكس', '', '', 1, '2021-08-30 23:52:11');
