INSERT INTO `email_templates` (`id`, `created_at`, `created_by_id`, `updated_at`, `updated_by_id`, `slug`, `email_subject_english`, `email_subject_arabic`, `email_body_english`, `email_body_arabic`) VALUES
(1, '2018-12-12 12:28:49', 1, '2022-08-03 13:39:40', 1, 'amendment_received', 'Adjustment Order', 'تأكيد طلب التعديل', 'Hi {username},<br /><br />We have received your adjustment request for order# {order_id}', 'مرحبًا {username} ،<br /><br /><br /> لقد تلقينا تعديلاتك للطلب رقم {order_id}'),
(2, '2018-12-12 12:29:38', 1, '2022-08-03 13:40:08', 1, 'artwork_done', 'Items Artwork Done', 'تم إكمال تصميم المواد', 'Great news! Your artwork is here and is ready to be downloaded.<br> Want something changed? Head to Edit in Dashboard and let us<br> know what you would like to adjust', 'يسعدنا إخبارك بأن تصاميمك أصبحت جاهزة للتحميل\r\n<br> تريد بعض التغييرات؟ اتجه إلى لوحة التحكم واضغط على تعديل لتخبرنا <br> بالذي ترغب في تعديله'),
(3, '2018-12-12 12:30:09', 1, '2021-10-31 21:13:08', 1, 'artwork_downloaded', 'We\'d Love to Get Your Feedback', 'يسعدنا سماع رأيك ', 'Thank you for choosing Bundl for your project.<br> Your opinion means alot to us, we want to make your experience<br> as quick, easy and fun as possible, and we\'d love it if you could<br> share your feedback in order for us to improve.', 'شكرًا لاختيارك بندل لمشروعك <br> رأيك يعني الكثير بالنسبة لنا ،  نريد أن نتطور ونجعل تجربتك <br> أسهل في كل مرة. لذلك نطلب منك <br> أن تشاركنا رأيك وسنبذل كل جهدنا لتطوير تجاربك معنا '),
(4, '2018-12-12 12:30:47', 1, '2021-03-22 22:40:58', 1, 'branding_done', 'Branding Artwork Done', 'تم إكمال شعار علامتك التجارية', 'Great news! Your brand logo is here. Love it? Go ahead and<br> approve it. Want something changed? Head to Edit in Dashboard<br> and let us know what you would like to adjust.', 'يسعدنا إخبارك بأن شعار هويتك أصبح جاهزا. كل ما عليك فعله هو\r\n <br>  الموافقة عليه. تريد شيئا يتغير؟ تريد بعض التغييرات؟ اتجه إلى لوحة التحكم واضغط على تعديل  Dashboard <br> لتخبرنا بالتعديلات التي تريدها.'),
(5, '2018-12-12 12:31:29', 1, '2021-10-31 20:54:43', 1, 'order_confirmed', 'Order Confirmation', 'تأكيد الطلب', 'Thank you for your order!', '!شكرا على طلبك\r\n'),
(6, '2018-12-12 12:32:17', 1, '2022-08-03 13:41:03', 1, 'order_placed', 'Order Placed', 'تم الطلب', '<p>Orders has been placed by {email}. Order ID: {order_id}</p>', '<p> تم تقديم الطلب عن طريق {email}. رقم الطلب: {order_id}</p>'),
(7, '2018-12-12 12:33:00', 1, '2022-08-03 13:41:48', 1, 'questionnaire_received', 'Questionnaire Completed ', 'تم إكمال الاستبيان', 'Thank you for filling us in on your project. We’re excited to get our creative juices flowing!', 'شكرا على إكمال الاستبيان! متحمسون للبدء في مشروعك\r\n'),
(8, '2020-11-17 18:48:55', 1, '2021-01-01 18:06:40', 1, 'bundldesigns', 'Welcome To Bundl', 'مرحبا بكم في بندل', 'Please select \'confirm\' button to complete your registration', 'الرجاء الضغط على زر “تأكيد” لإكمال عملية التسجيل \r\n'),
(9, '2020-11-17 20:52:38', 1, '2021-03-22 22:47:35', 1, 'forgot-password', 'Forgot Password', 'نسيت كلمة السر', 'Forgot your password? No worries it happens. To reset your <br>password just click on the below link. If you didn\'t make this<br> request, you can ignore this email.', 'نسيت كلمة السر؟ لا تقلق يحدث ذلك طوال الوقت. لإعادة تعيين <br> كلمة المرور ، كلمة السر الخاصة بك، اضغط على الرابط أدناه. إذا لم تطلب <br> إعادة التعيين يمكنك تجاهل هذا البريد الإلكتروني.'),
(10, '2020-11-17 22:46:07', 1, '2021-10-31 20:36:57', 1, 'order-adjustment', 'Adjustment Order Confirmation', 'تأكيد طلب التعديل', 'Thank you for your order!', '!شكرا على طلبك\r\n'),
(11, '2020-11-18 17:36:11', 1, '2021-10-31 22:38:49', 1, 'recommended', 'Recommend Us ', ' أوصي بنا ', 'You are invited by {invitee} to use Bundl for your design requirements.\r\n\r\nPlease click the button below to sign up.', 'تمت دعوتك من قبل\r\n  <br> {invitee} <br>  \r\nلاستخدام بندل لمشروعك\r\n<br>\r\nالرجاء الضغط على الرابط أدناه للتسجيل.'),
(12, '2021-03-20 22:39:41', 1, '2021-03-22 22:49:56', 1, 'promo-code', 'Promo Code', 'رمز ترويجي', 'Thank you for recommending us! We are so happy you liked working with us!\r\n\r\nYour promo code is {promo_code}', 'شكرا على الوصاية بنا! ويسعدنا أنك استمتعت بتجربتك معنا\r\n\r\nالرمز الترويجي الخاص بك هو {promo_code}'),
(13, '2021-03-26 20:54:36', 1, '2022-08-03 13:55:21', 1, 'recommend-us', 'Recommend Us', 'أوصي بنا', 'Know a friend that needs Bundl for their project? Refer us and get 5% off your next order.\r\n\r\nOnce you fill your friend\'s details on the below link, you will receive an email with your promo code.', 'لك صديق يحتاج خدمات بندل لمشروعهم؟ \r\n\r\n<br> قم بالوصاية بنا واحصل على خصم 5٪ على طلبك التالي.\r\n<br>\r\nبمجرد ملء تفاصيل صديقك على الرابط أدناه ، ستتلقى رسالة بريد إلكتروني تحتوي على الكود الترويجي الخاص بك'),
(14, '2018-12-12 12:31:29', 1, '2022-08-03 13:45:19', 1, 'payment_receipt', 'Order Receipt', 'تأكيد الطلب', 'Thank you for your order!', '!شكرا على طلبك\r\n'),
(15, '2020-11-17 20:52:38', 1, '2021-10-26 17:41:01', 1, 'reset-password', 'Reset Password', 'إعادة تعيين كلمة المرور', 'Your password has been changed!', 'تم إعادة تعيين كلمة السر الخاصة بك بنجاح'),
(16, '2020-11-17 20:52:38', 1, '2021-10-26 17:41:29', 1, 'contact-us-confirmation', 'WE GOT YOUR MESSAGE', 'لقد وصلتنا رسالتك', 'Thank you for reaching out! we will get back to you as soon as possible', 'شكرا لك على التواصل! سنعود إليك في أقرب وقت ممكن'),
(17, '2020-11-17 20:52:38', 1, '2021-10-26 17:41:43', 1, 'vacancy-application-confirmation', 'WE GOT YOUR APPLICATION', 'لقد حصلنا على طلبك', 'Thank you for your application! we will get back to you as soon as possible', 'شكرا لطلبك! سنعود إليك في أقرب وقت ممكن'),
(18, '2020-11-17 20:52:38', 1, '2021-10-26 17:41:58', 1, 'webster-confirmation', 'WE GOT YOUR MESSAGE', 'لقد وصلتنا رسالتك', 'Thank you for reaching out! we will get back to you as soon as possible', 'شكرا لك على التواصل! سنعود إليك في أقرب وقت ممكن'),
(19, '2020-11-17 20:52:38', 1, '2022-08-03 13:45:53', 1, 'content-upload-complete', 'CONTENT UPLOAD COMPLETED', 'اكتمل تحميل المحتوى', 'Thank you for uploading your content. <br>We’re excited to get designing!', 'شكرا لك على تحميل المحتوى الخاص بك. <br> !نحن متحمسون للبدء في التصاميم'),
(20, '2020-11-17 20:52:38', 1, '2022-08-03 13:47:45', 1, 'branding-approved', 'BRANDING APPROVED', 'تمت الموافقة على االهوية البصرية', 'We are thrilled you loved our work! What\'s next? We\'ll start designing the\r\nrest of the items in your bundl following your brand guide approval.', '! نحن سعداء لأنك أحببت التصاميم <br> \r\nماذا بعد؟ سنبدأ في تصميم  باقي العناصر في باقتك اتباعا لإرشادات الهوية البصرية المعتمدة');
INSERT INTO `faqs` (`id`, `created_at`, `created_by_id`, `updated_at`, `updated_by_id`, `question_english`, `question_arabic`, `category_id`, `answer_english`, `answer_arabic`) VALUES
(6, '2021-03-24 15:19:19', 1, '2021-07-16 00:58:41', 1, 'What is Bundl?', 'ما هو بندل؟', 4, 'Bundl is the first Arabic based online design services launched in 2021. We specialize in Brand Identity, Graphic design, and Web Design. We have created specific Bundl’s each with specific items to make it easier for you to get your needed design items.', 'تم انشاء بندل في عام ٢٠٢١، وهي أول صفحة إلكترونية عربية تقدم خدمات التصميم بتجربة مميزة اونلاين. نتخصص في تصميم الهوية، التصاميم الجرافيكية، وتصميم المواقع الإلكترونية. لقد قمنا بتخصيص \"بندلز\" تحتوي كل منها على مواد مختلفة حيث يمكنك اختيار البندل الملائم لمشروعك'),
(7, '2021-03-24 15:21:00', 1, '2021-08-30 23:10:37', 1, 'How does the process work?', 'ما هي طريقة عمل بندل؟', 4, '<p><strong>Step 1:</strong> Choose the Bundl that is right for your Project. Can&rsquo;t find what your looking for? Customize your own</p>\r\n<p><strong>Step 2:</strong>&nbsp;Tell us about your project and what you need designed. Not sure what you want? Our questionnaire will help you</p>\r\n<p><strong>Step 3:</strong>&nbsp;Your brand logo will be sent for your approval. Need something changed? Just Add-on an adjustment</p>\r\n<p><strong>Step 4:</strong>&nbsp;You can easily upload the contents for the items in your bundl. All designs will follow the guidelines of your approved brand</p>\r\n<p><strong>Step 5:</strong>&nbsp;Your designs will be sent to your account. Need more items? some adjustments? Just Add-on to your bundl</p>', '<p>١. اختر البندل المناسب لعملك. لم تجد ما تبحث عنه؟ صمم البندل الملائم لك</p>\r\n<p>٢. أخبرنا عن مشروعك وما تريد تصميمه. لست متأكد مما تريد؟ سوف يساعدك استبياننا</p>\r\n<p>٣. سيتم إرسال تصميم هويتك للحصول على موافقتك. تحتاج إلى تغيير شيء؟ فقط قم بإضافة تعديل</p>\r\n<p>٤. يمكنك بسهولة تحميل محتويات المواد الموجودة في البندل الخاصة بك. ستتبع جميع التصاميم ارشادات تصميم هويتك الموافق عليها.</p>\r\n<p>٥. سيتم إرسال تصاميمك إلى حسابك. هل تحتاج إلى المزيد؟ بعض التعديلات؟ فقط اضف ما تريد إلى البندل الخاصة بك</p>'),
(8, '2021-03-24 16:36:06', 1, '2021-07-16 01:00:00', 1, 'What makes you unique?', 'مالذي يميز بندل؟', 4, 'We are cost effective, time efficient, creative and personalised. We also do everything in Arabic as well.', 'السعر المنافس، سرعة التسليم، الإبداع وضمان الجودة حيث أن الأعمال الفنية كلها تصمم خصيصا لمتطلبات مشروعك. كما نتميز في اننا نقدم جميع الخدمات باللغة العربية أيضا'),
(9, '2021-03-24 17:44:42', 1, '2021-07-15 22:40:33', 1, 'What languages do you work with?', '  ماهي اللغات اللتي تعملون بها؟', 4, 'Arabic and English for now', 'العربية والانجليزية'),
(10, '2021-03-27 15:27:43', 1, '2021-09-08 12:18:21', 1, 'How do I contact customer service?', 'كيف يمكنني التواصل مع خدمة العملاء؟', 16, '<p><strong>Contact us methods:</strong></p>\r\n<p><strong>Email:&nbsp;</strong>info@bundldesigns.com</p>\r\n<p><strong>Message</strong>: send us a message through our \"contact us\" section&nbsp;</p>\r\n<p>https://bundldesigns.com/contact-us</p>\r\n<p><strong>Whatsap:</strong></p>\r\n<p>use the whatsap button found always on the left side or send us directily on +966543318362</p>', '<p><strong>طرق التواصل معنا:</strong></p>\r\n<p><strong>البريد الإلكتروني:&nbsp;</strong>info@bundldesigns.com</p>\r\n<p><strong>رسالة:&nbsp;</strong>تواصل معنا برسالة من خلال قسم \"تواصل معنا\"&nbsp;</p>\r\n<p>https://bundldesigns.com/contact-us&nbsp;</p>\r\n<p><strong>واتساب:&nbsp;</strong>استخدم رابط Whatsap المتواجد دائما في الجانب الأيسر من الصفحة أو إرسل لنا رسالة مباشرة على 966543318362+</p>'),
(11, '2021-03-27 15:31:33', 1, '2021-07-15 22:46:15', 1, 'How can I pay on Bundl?', 'ماهي طريقة الدفع على بندل؟', 8, 'You can purchase a Bundl using Visa or Master Cards. ', 'يمكنك شراء بندل عن طريق الدفع باستخدام بطاقة فيزا او ماستركارد'),
(12, '2021-03-27 15:32:56', 1, '2021-07-15 22:49:13', 1, 'When do I get charged?', 'متى سيتم سحب المبلغ؟', 8, 'The payment will be processed as soon as you confirm your order', 'ستتم اتمام عملية الشراء وسحب المبلغ على الفور عند تأكيد الطلب'),
(13, '2021-03-27 15:33:43', 1, '2021-07-15 22:51:54', 1, 'What is the currency of the items online?', 'ما هي عملات الشراء المتوفرة في بندل؟', 8, 'All items are priced with Saudi Arabian Riyals', 'جميع المواد مسعرة بالريال السعودي'),
(14, '2021-03-27 15:35:18', 1, '2021-07-16 01:01:31', 1, 'How do I register?', 'كيف يمكنني إنشاء حساب على بندل؟', 9, 'Go on the homepage and click the account icon at the upper right corner, then log-in and then you can then click register now', 'اضغط على أيقونة الحساب الموجودة في أعلى الصفحة  الرئيسية على اليسار . ثم اضغط على تسجيل الدخول ومن ثم على حساب جديد.'),
(15, '2021-03-27 15:36:34', 1, '2021-07-16 01:01:05', 1, 'How do I log-in?', 'كيف أدخل على حسابي؟', 9, 'Go on the homepage and click the account icon at the top right, a pop up window will appear, you can enter your username and password details to log in, or sign-in with google account or Facebook account', 'اضغط على أيقونة الحساب الموجودة في أعلى الصفحة  الرئيسية على اليسار . ثم اضغط على تسجيل الدخول ومن ثم ادخل اسم المستخدم وكلمة المرور أو يمكنك تسجيل الدخول عن طريق حسابك في Google account أو حسابك في Facebook'),
(16, '2021-03-27 15:37:48', 1, '2021-07-15 23:42:48', 1, 'Do I have to create an account to place an order?', 'هل أحتاج إنشاء حساب لإتمام عملية الشراء؟', 9, 'Yes, this is necessary to keep your questionnaire and the files saved to your account so you can access, adjust and download your artwork at any time', 'نعم، هذا ضروري للاحتفاظ باستبيان هويتك والملفات المحفوظة في حسابك حتى تتمكن من الوصول إلى تصاميمك لتنزيلها وتعديلها في أي وقت'),
(17, '2021-03-27 15:39:34', 1, '2021-07-15 23:15:04', 1, 'What if I forgot my password?', 'ماذا لو نسيت كلمة المرور؟', 9, 'Go on the account icon where you usually sign-in, and click forgot password. You will get a reset link sent to your email to create a new password', 'اذهب إلى أيقونة الحساب حيث عادة ما تقوم بتسجيل الدخول، واضغط على نسيت كلمة المرور. سيتم إرسال رابط إلى بريدك الإلكتروني لإنشاء كلمة مرور جديدة'),
(18, '2021-03-27 15:42:38', 1, '2021-07-15 23:24:30', 1, 'How do I customise my own bundl?', 'كيف يمكنني تصميم البندل الخاصة بي؟', 10, 'There is a Bundl on our Home Page called “Customize Bundl”, select that bundl and add the items that you need from our different design categories. ', 'يوجد بندل على الصفحة الرئيسية تسمى \"صمم البندل الخاصة بك\" حيث يمكنك اضافة المواد التي تحتاجها من فئات التصميم المختلفة لدينا.'),
(19, '2021-03-27 15:43:32', 1, '2021-07-15 23:42:33', 1, 'Can I remove an item from a selected Bundl?', 'هل يمكنني حذف مواد من البندل الذي إخترته؟', 10, 'You can\'t remove items that are already included in the selected bundl, however you can remove any add-ons you selected with the bundl. Alternatively, you can select \"customize bundl\" from our homepage where you can add all the items that you need.', 'لا يمكنك حذف المواد الموجودة مسبقا في البندل الذي إخترته، ولكن يمكنك حذف أي إضافات إخترتها مع البندل. يوجد أيضا بندل على الصفحة الرئيسية تسمى \"صمم البندل الخاصة بك\" حيث يمكنك اضافة المواد التي تحتاجها من فئات التصميم المختلفة لدينا.'),
(20, '2021-03-27 15:49:59', 1, '2021-07-16 00:47:02', 1, 'How do I edit my artwork?', 'كيف يمكنني تعديل تصميمي؟', 13, 'Head to your account icon, then click on projects. Select the bundl with the item you want to adjust, then click on edit. This will lead you to adjustment page where you will be able to purchase the adjustment that is right for you', 'اضغط على أيقونة حسابك ، ثم \"مشاريعي\". إختر البندل الذي يحتوي على المادة التي تريد تعديلها ، ثم اضغط تعديل. سيقودك هذا إلى صفحة التعديل التي ستتمكنك من شراء التعديل المناسب لإحتياجك'),
(21, '2021-03-27 15:50:49', 1, '2021-07-16 00:14:02', 1, 'What if I want to change/add something in the questionnaire?', 'ماذا لو أردت تغيير/ إضافة شيء ما على الاستبيان؟', 11, 'You can contact us on info@bundldesigns.com and we can help you change or add to your questionnaire', 'يمكنك التواصل معنا على info@bundldesigns.com لمساعدتك على اضافة أو تعديل معلومات الاستبيان'),
(23, '2021-03-27 15:55:58', 1, '2021-07-16 00:49:16', 1, 'Is there an express artwork submission?', 'هل توجد خدمة التسليم السريع؟', 12, 'At the moment all our artwork submissions are standard. We will try our best to send the designs as soon as possible.', 'لاتتوفر خدمة التسليم السريع حاليا! ولكن سنبذل قصارى جهدنا لإرسال التصميمات في أقرب وقت ممكن'),
(24, '2021-03-27 15:57:15', 1, '2021-07-16 00:21:22', 1, 'Will I get notified when the artwork is ready?', 'هل يتم التواصل معي عند انتهاء التصاميم؟', 12, 'Yes, you will get an email when an artwork is submitted to your account.', 'نعم، سيتم إرسال بريد إلكتروني فور تسليم أي تصميم لحسابك'),
(25, '2021-03-27 16:01:31', 1, '2021-07-16 00:25:39', 1, 'Are you going to send the artwork on my email?', 'هل سيتم إرسال التصاميم على البريد الإلكتروني؟', 12, 'Because design files are usually large in size, we send emails to inform you that your artwork is ready to be downloaded from your account ', 'لأن حجم ملفات التصاميم تكون عادة كبيرة الحجم، سنرسل لك بريد الكتروني لإعلامك بأن التصاميم جاهزة للتحميل من حسابك'),
(26, '2021-03-27 16:02:35', 1, '2021-07-16 00:29:08', 1, 'Will I see my designs used by another company or person?', 'هل سأرى تصاميمي مستخدمة من شركة أو شخص آخر؟', 12, 'No, all our designs are specifically made for you, and we will not use them for any other client.', 'لا، جميع تصميماتنا مصممة خصيصًا لك ولن نستخدمها لأي عميل آخر.'),
(27, '2021-03-27 16:05:48', 1, '2021-07-16 00:51:05', 1, 'Which file formats will I receive?', 'بأي صيغة سيتم ارسال التصاميم؟', 12, 'All artworks will be sent in the format appropriate to the item, these might include (ai. psd. ind, pdf, png) You will however always receive the source files which allows you to edit your designs as you please', 'سيتم إرسال جميع الأعمال الفنية بالصيغة المناسبة لها ، وقد يشمل ذلك (ai. psd. ind ، pdf ، png) ومع ذلك ، ستتلقى دائمًا الملفات المفتوحة التي تتيح لك تعديل تصاميمك حسب رغبتك'),
(28, '2021-03-27 16:07:09', 1, '2021-07-16 00:37:11', 1, 'Do I get the source file?', 'هل سأحصل على الملف المفتوح؟', 12, 'Yes, you will be able to download the source files from your account', 'نعم، كل الملفات ستتوفر في حسابك '),
(29, '2021-03-27 16:08:12', 1, '2021-07-16 00:39:46', 1, 'Where do I enter the promo code?', 'أين أدخل الرمز الترويجي؟', 14, 'Before checking out, there will be a field where you can enter the code to get a discount.', 'قبل الدفع ، ستكون هناك خانة لإدخال الرمز للحصول على خصم.'),
(30, '2021-03-27 16:11:25', 1, '2021-07-16 00:46:38', 1, 'What if I want to change a minor thing in the files?', 'ماذا لو أردت تغيير شيء بسيط في التصميم؟', 13, 'Go to \"Projects\" page on your dashboard. Click the Edit button next to the item you need to adjust. This will take you to the Adjustment page where you can purchase an adjustment and tell us what changes you need. You will also always receive the source files which allows you to edit your designs', 'اضغط على أيقونة حسابك ، ثم \"مشاريعي\". إختر البندل الذي يحتوي على المادة التي تريد تعديلها ، ثم اضغط تعديل. سيقودك هذا إلى صفحة التعديل التي ستتمكنك من شراء التعديل المناسب لإحتياجك. وأيضا ستتلقى دائمًا الملفات المفتوحة التي تتيح لك تعديل تصاميمك حسب رغبتك'),
(31, '2021-03-27 16:15:06', 1, '2021-07-16 01:25:57', 1, 'What is the policy on refunds/cancelations?', 'ماهي سياسة الإسترداد والإلغاء؟', 15, 'All Bundl artwork are personalised as per each order; therefore unfortunately we do not accept cancellations or refunds.\r\nIn exceptional circumstances where we have made a mistake or the artwork doesn\'t match the requested details, we will arrange to adjust the artwork as per the requested changes.\r\nIn this case please contact info@bundldesigns.com to discuss your particular situation and work for a satisfactory outcome.', 'لأن الأعمال الفنية صممت خصيصا لك، لاتوجد لدينا خاصية الإسترداد أو الإلغاء بعد عملية الشراء. في حال ارتكبنا خطأ أو لم يتطابق العمل الفني التفاصيل المطلوبة ، سنقوم بالترتيب لتعديل العمل الفني وفقًا للتغييرات المطلوبة.\r\nفي هذه الحالة ، يرجى التواصل معنا على info@bundldesigns.com لمناقشة وضعك الخاص والعمل من أجل نتيجة مرضية لك'),
(32, '2021-07-16 00:10:02', 1, NULL, NULL, 'How can I add on an item that follows the same brand identity design of a previously purchased project?', 'كيف يمكنني إضافة مادة تتبع نفس تصميم الهوية لمشروع تم شراؤه مسبقًا؟', 10, 'Head to your account icon, then click on projects. Select the bundl you want to add-on an item to, then select \"add-on\" to bundl below ', 'اضغط على أيقونة حسابك، ثم \"مشاريعي\". إختر البندل الذي تريد الإضافة اليه، ثم اضغط \"إضافة الى بندل\" أدناه'),
(33, '2021-07-16 01:10:40', 1, NULL, NULL, 'Why do I need to answer the questionnaire?', 'لماذا أحتاج للإجابة على الاستبيان؟', 11, 'The questionnaire helps us understand your project, and leads us to the brand identity that will work best to accomplish your goals. It will also help us create guidelines for design items that will follow the brand.', 'يساعدنا الاستبيان على فهم مشروعك وسيقودنا إلى تصميم الهوية التي ستعمل بشكل أفضل لتحقيق أهدافك. سيساعدنا أيضًا في إنشاء إرشادات الهوية التتي ستتبعها تصاميم المواد الأخرى في البندل'),
(34, '2021-07-16 01:17:56', 1, '2021-07-16 01:23:37', 1, 'I did not purchase a bundl with brand identity or logo design, why do I still need to answer the branding questionnaire?', 'لم أشتري بندل يحتوي على تصميم شعار أو هوية، فلماذا ما زلت بحاجة للإجابة على استبيان الهوية؟', 11, 'All items need to follow a brand identity. If this is your first time using bundl, we will need to know about your already existing brand identity in order to design items that will follow your brand guidelines. At a later stage if you want to add extra items that follows your brand identity, you can click \"add-on to bundl\" and you will not need to fill the questionnaire again.', 'يجب أن تتبع جميع المواد تصميم هوية معينة. إذا كانت هذه هي المرة الأولى التي تستخدم فيها بندل ، فسنحتاج إلى معرفة إرشادات هويتك التتي سنحتاج تتبعها للمواد المراد تصميمها. في مرحلة لاحقة ، إذا كنت ترغب في إضافة مواد إضافية تتبع هويتك، فيمكنك الضغط على \"إضافة الى بندل\" ولن تحتاج إلى ملء الاستبيان مرة أخرى.');
