INSERT INTO `packages` (`id`, `sort_order`, `created_at`, `created_by_id`, `updated_at`, `updated_by_id`, `name_english`, `name_arabic`, `slug`, `time`, `price`, `description_english`, `description_arabic`, `category_id`, `package_image_id`, `status`) VALUES
(3, 5, '2018-05-02 12:34:29', 1, '2022-09-28 15:24:10', 1, 'The Social Guru', 'السوشال جورو', 'the_professional', 20, '5000', 'The best way to attract your customers is through social media, and this bundl does just that. With the Social Guru, you will have the right social media designs that will definitely make your pages and content worth sharing.\r\n<br>*This bundl includes one minor revision', 'أفضل طريقة للوصول لعملائك هي عبر صفحات التواصل الاجتماعي، وعشان كذا بندل السوشال جورو موجود.\r\n البندل مخصص لإنشاء تصاميم تخلّي صفحات ومحتوى مشروعك يستاهل المتابعة على السوشال ميديا\r\n<br>*هذا البندل يحتوي على تعديل بسيط واحد', 10, 39, 1),
(4, 3, '2018-05-02 12:36:54', 1, '2022-09-28 15:22:08', 1, 'The Foodie', 'الفودي', 'the_big_shot', 20, '8200', 'This bundl is all you need to set you up and promote your restaurant, café or any project that involves food. The Foodie Bundl includes Logo Design, Brand Guide, and any necessary F&B collateral for your business. This bundl also includes awesome social media designs to make your pages look as awesome as what you’re offering. \r\n<br>*This bundl includes one minor revision', 'هذا البندل فيه كل اللي تحتاجه لإطلاق وترويج مطعمك أو مقهاك. يحتوي بندل الفودي على تصميم الشعار، دليل الهوية و كل تصاميم المنتجات اللي تحتاجها لمشروعك.  غير كذا، يحتوي البندل على تصاميم سوشال ميديا اللي حتضيف النكهة اللي تحتاجها عشان تجذب عملائك\r\n<br>*هذا البندل يحتوي على تعديل بسيط واحد', 9, 38, 1),
(12, 1, '2019-08-29 18:30:36', 1, '2022-09-28 15:22:42', 1, 'The Newbie', 'النيوبي', 'the-newbie', 20, '4800', 'Ready to kickstart your project or business? This bundl is tailored for you. It includes Logo Design and essential stationery needed to launch your brand.\r\n<br> *This bundl includes one minor revision\r\n', 'جاهز لبدء مشروعك أو متجرك؟ بندل النيوبي مصمم لك واللي يتضمن تصميم الشعار ودليل الهوية بالإضافة إلى تصاميم القرطاسية اللي تحتاجها لإطلاق مشروعك\r\n<br>*هذا البندل يحتوي على تعديل بسيط واحد', 2, NULL, 1),
(13, 2, '2019-08-29 19:29:06', 1, '2022-09-28 15:24:38', 1, 'The Socialite', 'سوشلايت', 'the-socialite', 20, '8450', 'Whether you’re a physical shop or an online store, this bundl has all that’s needed to make your products stand out. It includes Logo Design, Brand Guide, and any commerce collateral needed to upgrade your customer’s shopping experience. It also includes social media designs that will convert your customers from interested to purchased.\r\n<br>This bundl includes one minor revision', 'سواء كان عندك متجر فعلي أو اونلاين، هذ البندل المناسب لك، لأنه يحتوي على كل ما تحتاجه للترويج عن منتجاتك.. \r\nسوشلايت بندل يتضمن تصميم الشعار و دليل الهوية وتصاميم للسوشيال ميديا وأي تصاميم أخرى لمنتجاتك اللي راح تساعدك في تحسين تجربة عميلك في الشراء.\r\n<br>*هذا البندل يحتوي على تعديل بسيط واحد', 12, NULL, 1),
(20, 4, '2022-04-11 21:11:43', 1, '2022-09-28 15:23:27', 1, 'The Professional', 'البروفيشونال', 'the-professional', 20, '8500', 'Launching a new business or project? Or want to give your brand an upgraded personality? This bundl was created for you. It includes Logo Design, Brand Guide and the stationery needed to get you the leads you need. This bundl will also include social media posts that will help you attract any potential customers for your business or project.\r\n*This bundl includes one minor revision\r\n', 'عندك متجر أو مشروع جديد؟ أو حاب تعطي علامتك التجارية هوية جديدة؟ تم إنشاء هذي البندل لك، بحيث يتضمن تصميم الشعار و دليل الهوية وتصاميم القرطاسية اللازمة لعملك. يشمل هذه البندل على تصاميم سوشيال ميديا اللي بتساعدك على جذب أي عملاء محتملين لعملك أو مشروعك\r\n<br>*هذا البندل يحتوي على تعديل بسيط واحد', 13, NULL, 1);
