ne-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">Like many site operators, we collect information that your browser sends whenever you visit our Site (\"Log Data\").</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">This Log Data may include information such as your computer\'s Internet Protocol (\"IP\") address, browser type, browser version, the pages of our Site that you visit, the time and date of your visit, the time spent on those pages and other statistics.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">In addition, we may use third party services such as Google Analytics that collect, monitor and analyze this &hellip;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\"><strong>Communications</strong></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">We may use your Personal Information to contact you with newsletters, marketing or promotional materials an