important to us, but remember that no method of transmission over the Internet, or method of electronic storage, is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\"><strong>Changes To This Privacy Policy</strong></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">This Privacy Policy is effective as of&nbsp;<span style=\"font-size: 14.6667px;\">(17/12/2020)</span>&nbsp;and will remain in effect except with respect to any changes in its provisions in the future, which will be in effect immediately after being posted on this page.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">We reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">If we make any material changes to this Privacy Policy, we will notify you either through the email address you have provided us, or by placing a prominent notice on our website.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\"><strong>Contact Us</strong></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p><span style=\"font-family: Arial; font-size: 11pt;\">If you have any questions about this Privacy Policy, please contact&nbsp;</span><span style=\"font-family: Arial; font-size: 11pt;\">us on info@bundldesigns.com&nbsp;</span><span style=\"font-family: Arial; font-size: 11pt;\">or whatsap us on +966547754124</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <iframe style=\"width: auto; height: 250px; overflow-y: hidden;\" src=\"http://maroof.sa/Business/GetStamp?bid=209442\" frameborder=\"0\" seamless=\"seamless\"></iframe></span></span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial; padding-left: 60px; text-align: center;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt; line-height: 16.8667px; font-size: 11pt; font-family: Arial;\">&nbsp;</p>', '<p>آخر تحديث: (5 سبتمبر 2019)<br /><br />نشكرك على التسوق في BundlDesigns.com<br /><br />يرجى قراءة هذه الشروط والأحكام (\"الشروط\" ، \"الشروط والأحكام\") بعناية قبل استخدام موقع الويب http://BundlDesigns.com (\"الخدمة\") الذي تديره Bundl (\"نحن\" أو \"نحن\" أو \"لدينا \").<br /><br />إن وصولك إلى الخدمة واستخدامها مشروط بقبولك لهذه الشروط والامتثال لها. تنطبق هذه الشروط على جميع الزوار والمستخدمين وغيرهم ممن يصلون إلى الخدمة أو يستخدمونها.<br /><br />من خلال الوصول إلى الخدمة أو استخدامها ، فإنك توافق على الالتزام بهذه الشروط. إذا كنت لا توافق على أي جزء من الشروط ، فيرجى عدم استخدام الخدمة.<br /><br />المشتريات<br /><br />إذا كنت ترغب في شراء أي منتج أو خدمة يتم توفيرها من خلال الخدمة (\"الشراء\") ، فقد يُطلب منك تقديم معلومات معينة ذات صلة بعملية الشراء بما في ذلك ، على سبيل المثال لا الحصر ، اسمك الأول والأخير ورقم هاتفك وعنوان بريدك الإلكتروني و الموقع ورقم بطاقتك الائتمانية وتاريخ انتهاء صلاحية بطاقتك الائتمانية.<br /><br />نهاية<br /><br />يجوز لنا إنهاء أو تعليق الوصول إلى خدمتنا على الفور ، دون إشعار مسبق أو مسؤولية ، لأي سبب من الأسباب ، بما في ذلك على سبيل المثال لا الحصر إذا خرقت الشروط.<br /><br />يجب أن تظل جميع أحكام الشروط التي يجب أن تظل بطبيعتها سارية المفعول سارية المفعول ، بما في ذلك ، على سبيل المثال لا الحصر ، أحكام الملكية وإخلاء المسؤولية عن الضمان والتعويض وحدود المسؤولية.<br /><br /><br />الملكية الفكرية<br /><br />الخدمة وجميع المحتويات ، بما في ذلك على سبيل المثال لا الحصر ، النصوص أو الصور أو الرسومات أو الكود هي ملك لـ Bundl وهي محمية بموجب حقوق النشر والعلامات التجارية وقاعدة البيانات وحقوق الملكية الفكرية الأخرى. يجوز لك عرض ونسخ أو تنزيل أو طباعة أجزاء من المواد من مناطق مختلفة من الخدمة فقط لاستخدامك غير التجاري. أي استخدام آخر محظور تمامًا وقد ينتهك قوانين حقوق النشر والعلامات التجارية وغيرها من القوانين. لا تمنحك هذه الشروط ترخيصًا لاستخدام أي علامة تجارية لشركة Bundl أو الشركات التابعة لها. أنت توافق أيضًا على عدم استخدام أو تغيير أو حذف أي إشعارات ملكية من المواد التي تم تنزيلها من الخدمة.<br /><br /><br /><br />روابط لمواقع ويب أخرى<br /><br />قد تحتوي خدمتنا على روابط لمواقع أو خدمات ويب تابعة لجهات خارجية لا تملكها أو تسيطر عليها Bundl<br /><br />لا تتحكم Bundl ولا تتحمل أي مسؤولية عن المحتوى أو سياسات الخصوصية أو الممارسات الخاصة بأي مواقع أو خدمات ويب خاصة بطرف ثالث. أنت تقر وتوافق أيضًا على أن Bundl لن تكون مسؤولة أو مسؤولة ، بشكل مباشر أو غير مباشر ، عن أي ضرر أو خسارة ناتجة أو يُزعم أنها ناجمة عن أو فيما يتعلق باستخدام أو الاعتماد على أي محتوى أو سلع أو خدمات متاحة على أو من خلال أي من هذه المواقع أو الخدمات.<br /><br />ننصحك بشدة بقراءة الشروط والأحكام وسياسات الخصوصية الخاصة بأي مواقع ويب أو خدمات تابعة لجهات خارجية تزورها.<br /><br /><br />تحديد المسؤولية<br />لن تكون Bundl أو مديريها أو موظفيها أو شركائها أو وكلائها أو مورديها أو الشركات التابعة لها مسؤولة عن أي خسارة أو ضرر ، مباشر أو غير مباشر ، عرضي ، خاص ، تبعي أو عقابي ، بما في ذلك على سبيل المثال لا الحصر ، خسارة اقتصادية أو خسارة أو ضرر الوسائط أو البيانات الإلكترونية أو الشهرة أو الخسائر غير الملموسة الأخرى الناتجة عن (1) وصولك إلى الخدمة أو استخدامها ؛ (2) عدم قدرتك على الوصول إلى الخدمة أو استخدامها ؛ (3) أي سلوك أو محتوى لأي طرف ثالث في الخدمة أو متعلق بها ؛ (4) أي محتوى تم الحصول عليه من الخدمة أو من خلالها ؛ و (5) الوصول غير المصرح به إلى عمليات النقل أو المحتوى الخاصة بك أو استخدامها أو تغييرها ، سواء استنادًا إلى الضمان أو العقد أو الضرر (بما في ذلك الإهمال) أو أي مطالبة أخرى بموجب القانون ، سواء تم إبلاغنا بإمكانية حدوث ذلك أم لا الضرر ، وحتى إذا تبين أن العلاج المنصوص عليه هنا قد فشل في تحقيق غرضه الأساسي.<br /><br /><br />التغييرات<br /><br />نحتفظ بالحق ، وفقًا لتقديرنا الخاص ، في تعديل أو استبدال هذه الشروط في أي وقت. إذا كانت المراجعة جوهرية ، فسنحاول تقديم إشعار قبل 7 أيام على الأقل قبل تفعيل أي شروط جديدة. سيتم تحديد ما يشكل تغييرًا ماديًا وفقًا لتقديرنا الخاص.<br /><br />اتصل بنا<br /><br />إذا كانت لديك أي أسئلة حول هذه الشروط ، فيرجى التواصل معنا عبر الوتساب 966547754124+ أو بريدنا الإلكتروني&nbsp;<span style=\"font-family: Arial; font-size: 14.6667px;\">info@bundldesigns.com</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: Arial;\"><span style=\"font-size: 14.6667px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <iframe style=\"width: auto; height: 250px; overflow-y: hidden;\" src=\"http://maroof.sa/Business/GetStamp?bid=209442\" frameborder=\"0\" seamless=\"seamless\"></iframe></span></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2022-06-09 10:40:46');
INSERT INTO `testimonials` (`id`, `description_english`, `description_arabic`, `stars`, `created_on`) VALUES
(7, '<p>My experience with BUNDL has been and still is extremely wonderful!&nbsp;I genuinely believe they brought my brand to life and the work wouldn&rsquo;t have progressed the way it did so far without them. The level of efficiency, delivering quality work and professionalism is what I wish is available in every creative agency out there. I would definitely recommend BUNDL to everyone starting or has an established business running!<br /><br /><em><strong>SPEAK</strong> - Online Store</em></p>', '', 5, '2022-08-05 13:44:09'),
(8, '<p>&ldquo;YOU TRULY GET OUT WHAT YOU PUT IN&rdquo;</p>\r\n<p>Commitment, variety, clarity, fast delivery of different options, accuracy and art is the least that can describe how good they are! Keep up the good work, and we would surely get back to you over and over again!</p>\r\n<p><strong>SHAWARMAMAMA</strong> - Restuarant</p>', '', 5, '2022-06-06 13:25:24'),
(9, '<p>Working with the team at Bundl was seamless. The process is easy and straightforward. You add all the necessary details for your order on their website, once you submit you&rsquo;ll have a time frame to revert back with your order. The unique feature, which I loved, is the Add-on. If you still need a product or feature for your project you simply login and add it on. Bundl is your go to for an easy, seamless, creative space to build your brand.</p>\r\n<p><strong>Sija\'s</strong> - Bakery</p>', '', 5, '2022-06-06 13:28:08');
