(40, 8, 'Kalina Telfeyan', '98211686', 'kalina.telfeyan@gmail.com', 'Hello Bundl Designs,\r\n\r\nThank you for taking the time to review my CV. \r\nMy name is Kalina, I have studied architecture at the Lebanese American University but have worked in different fields such as graphic design/ 3D design and Art.\r\nI have worked as a freelance graphic designer for almost 2 years and as an NFT Artist for a year.\r\n\r\nNow, I have decided to make a shift in my career and become a full-time graphic designer.\r\nI have attached my CV with a clickable portfolio link below.\r\n\r\nLooking ', '1732', '2022-09-20 01:06:18'),
(41, 8, 'Sami Abdelwahed', '503790518', 'sami.abdelwahed92@gmail.com', 'I\'m pursuing new challenges and experiences and I am excited to find an Art Director opportunity here in Dubai. As a progressive professional with graphic design and art direction experience, I believe I can bring valuable contributions to your team.', '1792', '2022-11-11 06:06:40'),
(42, 8, 'زينب أحمد ', '560580882', 'Z.designer1712@gmail.com', 'Good evening,\r\nIt will be great opportunity to enhance my career in your esteemed company, especially since I have experience in advertising companies and organizing exhibitions companies too. \r\n\r\nPlease see the attached resume for more details about myself & my education.\r\nI will appreciate your call for any further questions.\r\nBest regards,\r\n\r\nZainab ????\r\nGraphic Designer', '1793', '2022-11-11 12:51:47');
